const Foodlist = ({ items, title }) => {
    return (
        <div>
            <h1> {title} </h1>
            <div className="food-list">
            {
                items.map((food) => {
                    return (
                        <div className="food">
                                <img src={food.pic} alt="" />
                                <h2>{food.foodName} </h2>
                                <h3> Price: {food.Price}</h3>
                        </div>
                    )

                })
            }
            </div>
        </div>
    );
}

export default Foodlist;
